import '../../../App.css'
import '../../../Styles/Dashboard.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faGlobe } from '@fortawesome/free-solid-svg-icons'

export default function DashboardMain() {


    const locationList = [
        {
            id: 1,
            province: 'Lâm Đồng',
            sold: 300
        },
        {
            id: 2,
            province: 'Lâm Đồng',
            sold: 200
        },
        {
            id: 3,
            province: 'Lâm Đồng',
            sold: 100
        },
        {
            id: 4,
            province: 'Lâm Đồng',
            sold: 200
        },
        {
            id: 5,
            province: 'Lâm Đồng',
            sold: 100
        },
        {
            id: 6,
            province: 'Lâm Đồng',
            sold: 30
        },
        {
            id: 7,
            province: 'Lâm Đồng',
            sold: 30
        }
    ]
    return (
        <div className="dashboard-main">
            <div className="top-location">
                <div className="top-location-headerbox flex-center">
                    <FontAwesomeIcon icon={faGlobe} className="icon"/>
                </div>
                <div className="top-location-container flex-col">
                    <div className="top-location-header">
                        <p>Global Sales by Top Locations</p>
                    </div>
                    <div className="top-location-content">
                        <div className="top-location-list"></div>
                        <div className="top-location-map"></div>
                    </div>
                </div>
            </div>
        </div>
    )
}
